import React from "react";

function GameBoard() {
  const treas = [
    2,
    3,
    2,
    "T",
    3,
    3,
    "T",
    3,
    3,
    2,
    2,
    3,
    2,
    2,
    1,
    3,
    "T",
    3,
    2,
    1,
    2,
    3,
    "T",
    3,
    2,
  ];
  const renderTreas = treas.map((item) => (
    <div className="boardCell" onClick={this.apiFunction}>
      {item}
    </div>
  ));
  return (
    <div>
      <h1>Game Board page</h1>
      <div className="wrapper">{renderTreas}</div>
    </div>
  );
}

export default GameBoard;
